import React from 'react'

export default class Animals extends React.Component {
  constructor (props) {
    super(props)
  }

  render () {
    return (<div>
   {this.props.animals.map((skill, index)=>(
    <div> 
      <h5>{skill.name}</h5>
      <img
        src={skill.image}
        alt={skill.name}
        width={width= '300px'}
      />
      <span>{skill.specie}</span>
       </div>
   ))

   }


    </div>
  )}
}
